// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma abicoder v2; // برای پشتیبانی از ساختارها در پارامترها

// OpenZeppelin ~3.4.0 Imports
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

// Uniswap V3 Periphery
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-periphery/contracts/interfaces/external/IWETH9.sol";

/**
 * @title TokenOperationsManager
 * @notice قرارداد مدیریت عملیات توکن مانند سوآپ، واریز و برداشت
 */
contract TokenOperationsManager is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    // --- متغیرهای وضعیت ---
    ISwapRouter public immutable swapRouter;
    address public immutable WETH9;

    // Struct for swap parameters
    struct SwapParams {
        address tokenIn;
        address tokenOut;
        uint24 poolFee;
        uint256 amountIn;
        uint256 amountOutMinimum;
        uint160 sqrtPriceLimitX96;
    }

    // --- رویدادها ---
    // رویداد ترکیبی برای واریز و برداشت توکن
    event TokenOperation(
        string operationType,
        address indexed token,
        address indexed user,
        uint256 amount
    );

    // رویداد ساده‌سازی شده برای سوآپ
    event Swapped(
        address indexed tokenIn,
        address indexed tokenOut,
        uint256 amountOut
    );

    // --- سازنده ---
    constructor(address _swapRouter, address _weth9, address _initialOwner) {
        // ذخیره مقادیر در متغیرهای immutable
        swapRouter = ISwapRouter(_swapRouter);
        WETH9 = _weth9;

        if (_initialOwner != address(0)) {
            transferOwnership(_initialOwner);
        }
    }

    // --- توابع مدیریت توکن ---
    function swap(
        SwapParams calldata params
    ) external nonReentrant onlyOwner returns (uint256 amountOut) {
        // انتقال توکن‌ها از فرستنده به قرارداد
        IERC20(params.tokenIn).safeTransferFrom(
            msg.sender,
            address(this),
            params.amountIn
        );

        // اجرای سوآپ در یک تابع جداگانه برای کاهش عمق پشته
        amountOut = _executeSwap(params);

        return amountOut;
    }

    // تابع کمکی برای اجرای سوآپ - کاهش عمق پشته
    function _executeSwap(
        SwapParams calldata params
    ) internal returns (uint256 amountOut) {
        // تأیید روتر برای خرج توکن‌ها
        IERC20(params.tokenIn).safeApprove(
            address(swapRouter),
            params.amountIn
        );

        // انجام سوآپ
        ISwapRouter.ExactInputSingleParams memory swapParams = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: params.tokenIn,
                tokenOut: params.tokenOut,
                fee: params.poolFee,
                recipient: address(this),
                deadline: block.timestamp,
                amountIn: params.amountIn,
                amountOutMinimum: params.amountOutMinimum,
                sqrtPriceLimitX96: params.sqrtPriceLimitX96
            });

        amountOut = swapRouter.exactInputSingle(swapParams);
        emit Swapped(params.tokenIn, params.tokenOut, amountOut);

        // بازنشانی تأیید
        IERC20(params.tokenIn).safeApprove(address(swapRouter), 0);

        return amountOut;
    }

    // --- توابع مدیریت ترکیبی توکن (فقط مالک) ---
    function manageToken(
        string memory operation,
        address token,
        uint256 amount,
        address payable recipient
    ) external payable nonReentrant onlyOwner {
        require(amount > 0, "Amount must be > 0");
        bytes32 opHash = keccak256(abi.encodePacked(operation));

        if (opHash == keccak256("DEPOSIT")) {
            _handleDeposit(token, amount);
        } else if (opHash == keccak256("WITHDRAW")) {
            _handleWithdrawal(token, amount, recipient);
        } else {
            revert("Invalid operation type");
        }
    }

    // تابع کمکی برای مدیریت واریزها - کاهش عمق پشته
    function _handleDeposit(address token, uint256 amount) internal {
        require(msg.sender == owner(), "Only owner can deposit");

        if (token == WETH9) {
            require(msg.value == amount, "ETH value mismatch");
            require(WETH9 != address(0), "WETH9 address not set");
            IWETH9(WETH9).deposit{value: amount}();
            emit TokenOperation("DEPOSIT", WETH9, msg.sender, amount);
        } else {
            require(msg.value == 0, "ETH sent for token deposit");
            IERC20(token).safeTransferFrom(msg.sender, address(this), amount);
            emit TokenOperation("DEPOSIT", token, msg.sender, amount);
        }
    }

    // تابع کمکی برای مدیریت برداشت‌ها - کاهش عمق پشته
    function _handleWithdrawal(
        address token,
        uint256 amount,
        address payable recipient
    ) internal {
        require(recipient != address(0), "Invalid recipient");
        require(msg.value == 0, "ETH sent for withdrawal");

        if (token == WETH9) {
            require(WETH9 != address(0), "WETH9 address not set");
            uint256 balanceWETH = IERC20(WETH9).balanceOf(address(this));
            require(balanceWETH >= amount, "Insufficient WETH balance");
            IWETH9(WETH9).withdraw(amount);
            recipient.transfer(amount);
            emit TokenOperation("WITHDRAW", WETH9, recipient, amount);
        } else {
            uint256 balanceToken = IERC20(token).balanceOf(address(this));
            require(balanceToken >= amount, "Insufficient token balance");
            IERC20(token).safeTransfer(recipient, amount);
            emit TokenOperation("WITHDRAW", token, recipient, amount);
        }
    }

    // --- توابع پرداخت ---
    receive() external payable {}

    function refundETH() external payable onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to refund");
        payable(msg.sender).transfer(balance);
    }

    function sweepToken(
        address token,
        uint256 amountMinimum,
        address recipient
    ) external payable onlyOwner {
        require(recipient != address(0), "Invalid recipient");
        uint256 balance = IERC20(token).balanceOf(address(this));
        require(balance >= amountMinimum, "Insufficient balance");
        IERC20(token).safeTransfer(recipient, balance);
    }

    function unwrapWETH9(
        uint256 amountMinimum,
        address recipient
    ) external payable onlyOwner {
        require(WETH9 != address(0), "WETH9 not set");
        require(recipient != address(0), "Invalid recipient");
        uint256 balance = IWETH9(WETH9).balanceOf(address(this));
        require(balance >= amountMinimum, "Insufficient WETH");
        if (balance > 0) {
            IWETH9(WETH9).withdraw(balance);
            payable(recipient).transfer(balance);
        }
    }

    // --- توابع نمایشی ---
    function getTokenBalance(address token) external view returns (uint256) {
        return IERC20(token).balanceOf(address(this));
    }

    function getETHBalance() external view returns (uint256) {
        return address(this).balance;
    }
}

contracts/TokenOperationsManagerOptimize.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma abicoder v2;

// Minimized imports
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-periphery/contracts/interfaces/external/IWETH9.sol";

/**
 * @title TokenOperationsManagerOptimized
 * @notice بهینه‌سازی شده برای کاهش اندازه قرارداد
 */
contract TokenOperationsManagerOptimized is Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    // Core state variables
    ISwapRouter public immutable swapRouter;
    address public immutable WETH9;

    // Single combined event for all operations
    event Operation(
        bytes32 indexed opType,
        address indexed tokenA,
        address indexed tokenB,
        uint256 amount
    );

    constructor(address _swapRouter, address _weth9) {
        swapRouter = ISwapRouter(_swapRouter);
        WETH9 = _weth9;
    }

    // Optimized swap function
    function swap(
        address tokenIn,
        address tokenOut,
        uint24 poolFee,
        uint256 amountIn,
        uint256 amountOutMin
    ) external onlyOwner returns (uint256 amountOut) {
        // Transfer tokens to contract
        IERC20(tokenIn).safeTransferFrom(msg.sender, address(this), amountIn);

        // Approve router
        IERC20(tokenIn).safeApprove(address(swapRouter), amountIn);

        // Execute swap
        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: tokenIn,
                tokenOut: tokenOut,
                fee: poolFee,
                recipient: address(this),
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: amountOutMin,
                sqrtPriceLimitX96: 0
            });

        amountOut = swapRouter.exactInputSingle(params);

        // Reset approval
        IERC20(tokenIn).safeApprove(address(swapRouter), 0);

        emit Operation(bytes32("SWAP"), tokenIn, tokenOut, amountOut);

        return amountOut;
    }

    // Deposit tokens (including ETH via WETH)
    function deposit(address token, uint256 amount) external payable onlyOwner {
        if (token == WETH9) {
            require(msg.value == amount, "ETH value != amount");
            IWETH9(WETH9).deposit{value: amount}();
        } else {
            require(msg.value == 0, "ETH not needed");
            IERC20(token).safeTransferFrom(msg.sender, address(this), amount);
        }

        emit Operation(bytes32("DEPOSIT"), token, address(0), amount);
    }

    // Withdraw tokens (including ETH via WETH)
    function withdraw(address token, uint256 amount) external onlyOwner {
        if (token == WETH9) {
            uint256 balance = IERC20(WETH9).balanceOf(address(this));
            require(balance >= amount, "Insufficient WETH");
            IWETH9(WETH9).withdraw(amount);
            payable(msg.sender).transfer(amount);
        } else {
            uint256 balance = IERC20(token).balanceOf(address(this));
            require(balance >= amount, "Insufficient balance");
            IERC20(token).safeTransfer(msg.sender, amount);
        }

        emit Operation(bytes32("WITHDRAW"), token, address(0), amount);
    }

    // Combined function for handling ETH
    function handleETH(
        bytes32 action,
        uint256 minAmount,
        address recipient
    ) external onlyOwner {
        address payable to = recipient == address(0)
            ? payable(msg.sender)
            : payable(recipient);

        if (action == bytes32("REFUND_ETH")) {
            uint256 balance = address(this).balance;
            require(balance >= minAmount, "Insufficient ETH");
            to.transfer(balance);
            emit Operation(action, address(0), address(0), balance);
        } else if (action == bytes32("UNWRAP_WETH")) {
            uint256 balance = IERC20(WETH9).balanceOf(address(this));
            require(balance >= minAmount, "Insufficient WETH");
            IWETH9(WETH9).withdraw(balance);
            to.transfer(balance);
            emit Operation(action, WETH9, address(0), balance);
        } else if (
            action == bytes32("SWEEP_TOKEN") && recipient != address(0)
        ) {
            // The recipient must be provided for this operation
            // This operation is handled separately to avoid stack too deep errors
            revert("Use sweepToken function");
        } else {
            revert("Invalid action");
        }
    }

    // Separate function for token sweeping to avoid stack too deep
    function sweepToken(
        address token,
        uint256 minAmount,
        address recipient
    ) external onlyOwner {
        require(recipient != address(0), "Invalid recipient");
        uint256 balance = IERC20(token).balanceOf(address(this));
        require(balance >= minAmount, "Insufficient balance");
        IERC20(token).safeTransfer(recipient, balance);
        emit Operation(bytes32("SWEEP_TOKEN"), token, address(0), balance);
    }

    // Simplified view functions
    function getBalance(address token) external view returns (uint256) {
        return
            token == address(0)
                ? address(this).balance
                : IERC20(token).balanceOf(address(this));
    }

    // Required to receive ETH
    receive() external payable {}
}

